import React, { useState, useEffect } from "react";

const Chat = ({socket})=> {
    const [chat, setChat] = useState([]);

    useEffect(() => {

      socket.on("CHAT", data => {
        setChat(data);
      });
    }, []);

    return (
      <p>
       <p>chat </p>
      {chat.map(mensaje => <div>{mensaje.name}</div>)}</p>

    );
}

export default Chat;
